DROP TABLE IF EXISTS "Customer" CASCADE;

DROP TABLE IF EXISTS "Product" CASCADE;

DROP TABLE IF EXISTS "Order" CASCADE;

DROP TABLE IF EXISTS "OrderDetail" CASCADE;

DROP TABLE IF EXISTS "Promotion" CASCADE;

CREATE TABLE "Customer" ( 
	"id" int NOT NULL,
	"name" varchar(50) NOT NULL,
	"phone" varchar(50) NOT NULL,
	"addressLine1" varchar(50) NOT NULL,
	"addressLine2" varchar(50) DEFAULT NULL,
	"city" varchar(50) NOT NULL,
	"state" varchar(50) DEFAULT NULL,
	"postalCode" varchar(15) DEFAULT NULL,
	"country" varchar(50) NOT NULL,
	"creditLimit" integer DEFAULT NULL,
	PRIMARY KEY ("id")
);

CREATE TABLE "Product" ( 
	"productCode" varchar NOT NULL,
	"productName" varchar NOT NULL,
	"productSize" varchar NOT NULL,
	"productVendor" varchar NOT NULL,
	"productDescription" text NOT NULL,
	"quantityInStock" integer NOT NULL,
	"buyPrice" numeric(6,2) NOT NULL,
	"MSRP" numeric(6,2) NOT NULL,
	"departmentCode" varchar NOT NULL,
	PRIMARY KEY ("productCode")
);

CREATE TABLE "Order" ( 
	"orderNumber" integer NOT NULL,
	"orderDate" date NOT NULL,
	"comments" text,
	"customerNumber" integer NOT NULL,
	PRIMARY KEY ("orderNumber"),
	CONSTRAINT "orders_ibfk_1" FOREIGN KEY ("customerNumber") REFERENCES "Customer" ("id")
);

CREATE TABLE "OrderDetail" ( 
	"orderNumber" integer NOT NULL,
	"productCode" varchar(15) NOT NULL,
	"quantityOrdered" integer NOT NULL,
	"msrp" numeric(6,2) NOT NULL,
	"discount" integer NOT NULL,
	PRIMARY KEY ("orderNumber","productCode"),
	CONSTRAINT "orderdetails_ibfk_2" FOREIGN KEY ("productCode") REFERENCES "Product" ("productCode"),
	CONSTRAINT "orderdetails_ibfk_1" FOREIGN KEY ("orderNumber") REFERENCES "Order" ("orderNumber")
);

CREATE TABLE "Promotion" ( 
	"id" integer NOT NULL,
	"productCode" varchar(15) NOT NULL,
	"discount" decimal(4,2) NOT NULL,
	PRIMARY KEY ("id","productCode"),
	CONSTRAINT "orderdetails_ibfk_2" FOREIGN KEY ("productCode") REFERENCES "Product" ("productCode")
);

